import React,{Component} from 'react';

const App =()=>{
  return (
  <Counter>
  </Counter>
  )
}
class Counter extends Component{
  super(props){
    console.log(this.state)
    this.state ={count:0}
  }
  render(){
    return(<div>{this.state.count}</div>)
  }
}
export default App;
